            expect(isArrayLike(document.childNodes)).toBeTruthy()
            expect(isArrayLike(arguments)).toBeTruthy()
            expect(!isArrayLike(null)).toBeTruthy()
            expect(!isArrayLike(undefined)).toBeTruthy()
            expect(!isArrayLike(true)).toBeTruthy()
