            expect(deepEquals(null, void 0)).toBe(false)
            expect(deepEquals(void 0, void 0)).toBe(true)
            expect(deepEquals(null, 111)).toBe(false)
            expect(deepEquals([1, 2, 3], [4, 5, 6, 7, 8])).toBe(false)
